import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
        <Switch>
            <AppRoute
                exact
                path="/"
                layout={LegacyLayout}
                component={WithTracker(HomeView)}
            />
            <AppRoute
                path="*"
                layout={LegacyLayout}
                component={WithTracker(PageNotFound)}
            />
        </Switch>
    );
  }
}

export default App;
